  routes logged by the Vermont Agency of Transportation. These routes are represented
  in the ETE route subclass. ETE stands for End-to-End route system, meaning that
  routes increment from start to finish without resetting at town boundaries. Linework
  and attributes were extracted from TransRoad_RDS (April 2000 version).\",\n\t\"license_title\":
